import Typed from 'react-typed'

const Header = () => {
  return (
    <div className='w-full h-screen bg-[#000300] flex xl:px-0 sm:px-16 flex-col justify-between'>
        <div className='grid md:grid-cols-2 col-span-2 max-w-[1240px] m-auto'>
            <div className='flex flex-col justify-center md:items-start w-full px-2 py-8'>
                <p className=' text-5xl bg-clip-text font-extrabold text-white '>Play the lottery</p>
                <Typed 
                className=' py-3 text-7xl md:text-7xl bg-clip-text font-extrabold  text-transparent bg-gradient-to-r from-blue-500 to-cyan-300'
                  strings={['transparently', 'secure', 'cheap']}
                  typeSpeed={120}
                  backSpeed={140}
                  loop
                />
                <p className='text-4 text-7xl bg-clip-text font-extrabold text-white'>on StarkNet</p>
                <p className=' text-5xl bg-clip-text font-extrabold text-white'> thanks to <a href='#' className='bg-clip-text font-extrabold text-transparent bg-gradient-to-r from-blue-500 to-cyan-300 '>LUCKSTARK</a> </p>
            </div>

        </div>

    </div>
  )
}

export default Header
